const App = (props) => (
  <div class="col-12 col-sm-10 col-md-8 panels-col-lg-3 col-lg-3 order-4 d-flex flex-column align-items-center justify-content-start panelShadow panelWidth panelOther ">
      <p class="mt-3 h3">{props.name}</p>
      <p class="text-break">{props.description}</p>
      <button class="btn btn-secondary order-button m-3">{props.price}</button>
  </div>
);
export default App;
